import logo from './logo.svg';
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container,Row,Col, Navbar, Nav} from 'react-bootstrap'
import RifatLogo from './Logo.png'
import horLine from './LineHorizontal.png'
import reactLogo from './reactLogo.png'
import { Github,Instagram ,EnvelopeAtFill} from 'react-bootstrap-icons';
import NavBar from './components/NavBar';

function App() {
  return (
    <div fluid className="App d-flex flex-column ">
      <NavBar/>

      <div  className='d-flex flex-column  heroSection' >
   
          <Row className='d-inline'>
            <Col className=' text-left'>
              <h5 className ='text-white bold normalText '>Hallo,mein Name ist</h5>
              <p className='primaryColor title bold'>Eremiya Rifat</p>
              <h4 className='text-white bold normalText'>Ich bin</h4>
              <p className='primaryColor bigTitle bold '>Webdesigner</p>
            </Col>
          </Row>
      
            
        

        
      </div>

          <div className='socialMediaContainer'>
            <div className='socialIconContainer'>
              <Github size={45} color="#B2BEC3" />
              <Instagram size={45}  color="#B2BEC3"/>
              <EnvelopeAtFill size={45} color="#B2BEC3"/>
            </div>
            <img src={horLine} className="horLine"/>
          </div>
           
            <img src={reactLogo}  className="reactLogo"/>
    </div>
  );
}

export default App;
